import React from 'react';

const icons = {
  templates: (
    <svg width="40" height="40" fill="none" viewBox="0 0 24 24" className="mb-3 text-blue-400"><rect x="3" y="5" width="18" height="14" rx="3" stroke="currentColor" strokeWidth="2"/><rect x="7" y="9" width="10" height="2" rx="1" fill="currentColor"/><rect x="7" y="13" width="6" height="2" rx="1" fill="currentColor"/></svg>
  ),
  create: (
    <svg width="48" height="48" fill="none" viewBox="0 0 24 24" className="mb-3 text-green-400"><circle cx="12" cy="12" r="10" stroke="currentColor" strokeWidth="2"/><path d="M12 8v8M8 12h8" stroke="currentColor" strokeWidth="2" strokeLinecap="round"/></svg>
  ),
  discover: (
    <svg width="40" height="40" fill="none" viewBox="0 0 24 24" className="mb-3 text-purple-400"><circle cx="12" cy="12" r="10" stroke="currentColor" strokeWidth="2"/><path d="M12 8v4l3 3" stroke="currentColor" strokeWidth="2" strokeLinecap="round"/></svg>
  ),
};

export default function WelcomeScreen() {
  return (
    <div className="min-h-[80vh] flex flex-col items-center justify-center px-4 py-12">
      <div className="text-center mb-12">
        <h1
          className="text-7xl font-extrabold tracking-widest mb-4 bg-gradient-to-r from-gray-100 via-gray-400 to-gray-100 bg-clip-text text-transparent"
          style={{
            textShadow:
              '0 6px 32px #000, 0 2px 0 #fff2, 0 1px 0 #fff4, 0 0.5px 0 #fff6',
            letterSpacing: '0.15em',
          }}
        >
          SCOPE<sup className="text-3xl align-super ml-1">Â²</sup>
        </h1>
        <p className="text-2xl text-gray-300 drop-shadow-[0_1px_4px_rgba(0,0,0,0.7)] font-medium">
          Choose a trading workflow to get started
        </p>
      </div>
      <div className="grid grid-cols-1 md:grid-cols-3 gap-10 max-w-5xl w-full">
        {/* Templates Card */}
        <div className="cursor-pointer bg-black/40 backdrop-blur-2xl rounded-2xl border border-blue-400/30 shadow-2xl p-12 flex flex-col items-center transition hover:scale-105 hover:shadow-blue-400/30 hover:border-blue-400/60 hover:shadow-2xl duration-200 group">
          {icons.templates}
          <h2 className="text-2xl font-extrabold text-white drop-shadow mb-2 group-hover:text-blue-300 transition" style={{textShadow:'0 2px 8px #000, 0 1px 0 #fff2'}}>Templates</h2>
          <p className="text-gray-200 mb-4 drop-shadow text-lg font-medium text-center">Explore prebuilt workflows</p>
        </div>
        {/* Create Card */}
        <div className="cursor-pointer bg-black/40 backdrop-blur-2xl rounded-2xl border border-green-400/30 shadow-2xl p-12 flex flex-col items-center transition hover:scale-105 hover:shadow-green-400/30 hover:border-green-400/60 hover:shadow-2xl duration-200 group">
          {icons.create}
          <h2 className="text-2xl font-extrabold text-white drop-shadow mb-2 group-hover:text-green-300 transition" style={{textShadow:'0 2px 8px #000, 0 1px 0 #fff2'}}>Create</h2>
          <p className="text-gray-200 mb-4 drop-shadow text-lg font-medium text-center">Build your own workspace</p>
        </div>
        {/* Discover Card */}
        <div className="cursor-pointer bg-black/40 backdrop-blur-2xl rounded-2xl border border-purple-400/30 shadow-2xl p-12 flex flex-col items-center transition hover:scale-105 hover:shadow-purple-400/30 hover:border-purple-400/60 hover:shadow-2xl duration-200 group">
          {icons.discover}
          <h2 className="text-2xl font-extrabold text-white drop-shadow mb-2 group-hover:text-purple-300 transition" style={{textShadow:'0 2px 8px #000, 0 1px 0 #fff2'}}>Discover</h2>
          <p className="text-gray-200 mb-4 drop-shadow text-lg font-medium text-center">Browse workflows from the community</p>
        </div>
      </div>
    </div>
  );
}
